import React from 'react';
import s from './Counter.module.css'

type CounterType = {
    inc: () => void
    reset: () => void
    disable: number
    StartValue: number
    editMode:boolean
    fastMax:number
    fastMin:number
}


export const Counter = (props: CounterType) => {


    const Inc = () => {
        props.inc()
    }

    const Reset = () => {
        props.reset()
    }

    const Div =()=> {
        return (<div>
            {props.StartValue}
        </div>)
    }

    return (
        <div className={s.around_wrapper}>
            <div className={s.score}>
                <div className={props.StartValue >= props.disable ? s.error : ''}>{Div()}</div>
            </div>

            <div className={s.around}>
                <button onClick={Inc} disabled={props.StartValue >= props.disable} className={s.button}>inc</button>
                <button onClick={Reset} className={s.button}>reset</button>
            </div>

        </div>
    );
};
